import React from "react";
import "./App.css";

<Tabla />;

class Tabla extends Component {
  constructor(state) {
    super(state);
    this.state = {
      fila: []
    };
  }
  render() {
    return (
      <table class="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">First</th>
            <th scope="col">Last</th>
            <th scope="col">Handle</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

class Ejercicio extends React.Component {
  render() {
    return (
      <div className="input-group mb-3">
        <input
          id="ejer"
          className="form-control"
          placeholder="Ejercicio"
          type="text"
        />
        <input className="form-control" placeholder="Series" type="number" />
        <input className="form-control" placeholder="Repes" type="number" />
        <input className="form-control" placeholder="Kg" type="number" />
      </div>
    );
  }
}

class Mas extends React.Component {
  constructor(state) {
    super(state);
    this.state = {
      clickead: 0,
      ejercicios: []
    };
  }

  handleClick = () => {
    this.setState({ clickead: 1 });
    const aux = new Ejercicio();
    let ejs = this.state.ejercicios;
    ejs.push(aux);
    this.setState({ ejercicios: ejs });
  };
  render() {
    return (
      <div id="div-center" className="container">
        <button
          className="btn btn-primary m-2"
          aria-label="Left Align"
          onClick={this.handleClick}
        >
          +
        </button>

        {this.state.ejercicios.map(ejercicio => (
          <Ejercicio />
        ))}
      </div>
    );
  }
}

export default Mas;
